import {View, Text, StyleSheet, FlatList} from 'react-native';

var data = [
  {name: 'zaeem ahmad'},
  {name: 'ali'},
  {name: 'talha'},
  {name: 'hassan'},
  {name: 'ikhlaq'},
  {name: 'babar'},
  {name: 'sufi'},
  {name: 'faisal'},
  {name: 'umair'},
  {name: 'farhan'},
  {name: 'adnan'},
  {name: 'bilal'},
];

const App = () => {
  return(
    <View style={styles.mainContainer}>
      <FlatList horizontal={false} data={data} renderItem={(element) => {console.log(element)
        return (<Text key={(element.index).toString} style={styles.item}>{element.item.name}</Text>)
      }}/>
    </View>
  )
}

export default App;

const styles = StyleSheet.create({
  mainContainer:{
    marginTop: '20%',
    alignItems: 'center'

  },
  item: {
    backgroundColor: 'green',
    marginTop: '10%',
    marginBottom: '10%',
    paddingTop: '20%',
    paddingBottom: '20%',
    // width: '30%'
  }
});
